import React, { useState } from 'react'
import { useEffect } from 'react'
import Menudisplay from './Menudisplay'

function Menudata({Menudata}) {

 const games=Menudata.map((game)=>{
   return(
     <div key={game.id}>
       <img src={game.thumbnail}/>
     </div>
   )
 })

  return (
  <>{games}</>
  )
}

export default Menudata
